import { useEffect, useState } from "react";
import axios from "axios";
import ErrorText from "../../../../components/Typography/ErrorText";

function ViewModalBodyUser({ closeModal, userId }) {
    const [userObj, setUserObj] = useState({}); // Inisialisasi sebagai objek kosong
    const [errorMessage, setErrorMessage] = useState("");
    
    useEffect(() => {
        const fetchUser = async () => {
            try {
                const response = await axios.get(`http://localhost:5000/users/${userId}`);
                setUserObj(response.data);
            } catch (error) {
                setErrorMessage("User not found.");
                console.error("Error:", error);
            }
        };

        fetchUser();
    }, [userId]);

    // Pengecekan untuk menghindari akses properti yang tidak ada
    if (!userObj || Object.keys(userObj).length === 0) {
        return <p className="text-center text-gray-500">Loading...</p>;
    }

    return (
        <>
            <div className="mt-4">
                <div className="flex items-center rounded-lg p-3">
                    <label className="block text-sm font-bold w-1/4">Profile</label>
                    <div className="avatar">
                        <div className="mask mask-squircle w-12 h-12 mr-4">
                            <img src={userObj.profilImg} alt="Profile" />
                        </div>
                    </div>
                </div>
            </div>
            <div className="mt-4">
                <div className="flex items-center bg-gray-200 rounded-lg p-3">
                    <label className="block text-sm font-bold w-1/4">Name</label>
                    <p className="w-3/4">{userObj.name || "N/A"}</p> 
                </div>
            </div>
            <div className="mt-4">
                <div className="flex items-center rounded-lg p-3">
                    <label className="block text-sm font-bold w-1/4">Phone</label>
                    <p className="w-3/4">{userObj.phone || "N/A"}</p>
                </div>
            </div>
            <div className="mt-4">
                <div className="flex items-center bg-gray-200 rounded-lg p-3">
                    <label className="block text-sm font-bold w-1/4">Email</label>
                    <p className="w-3/4">{userObj.email || "N/A"}</p>
                </div>
            </div>            
            <div className="mt-4">
                <div className="flex items-center rounded-lg p-3">
                    <label className="block text-sm font-bold w-1/4">Password</label>
                    <p className="w-3/4">{userObj.password || "N/A"}</p>
                </div>
            </div>
            <div className="mt-4">
                <div className="flex items-center bg-gray-200 rounded-lg p-3">
                    <label className="block text-sm font-bold w-1/4">Role</label>
                    <p className="w-3/4">{userObj.role || "N/A"}</p>
                </div>
            </div>
            <div className="mt-4">
                <div className="flex items-center rounded-lg p-3">
                    <label className="block text-sm font-bold w-1/4">Status</label>
                    <p className="w-3/4">{userObj.status || "N/A"}</p>
                </div>
            </div>

            {errorMessage && <ErrorText styleClass="mt-16">{errorMessage}</ErrorText>}
            <div className="modal-action">                
                <button className="btn btn-primary px-6" onClick={() => closeModal()}>OK</button>
            </div>
        </>
    );
}

export default ViewModalBodyUser;
